        return(
            <tr key={index}>
                
            </tr>
        )
    })
    return (
      <div className='container m-2'>
        <h2>Danh Sach Loai San Pham</h2>
        <table className='table table-bordered'>
            <thead>
                <tr>#</tr>
                <tr>Ma Loai</tr>
                <tr>Ten Loai</tr>
                <tr>Trang Thai</tr>
                <tr>Chuc Nang</tr>
            </thead>
        </table>
      </div>
    )
  }
